import React from 'react';
import './home.css'
import {
  MDBBtn,
  MDBNavbarLink
} from 'mdb-react-ui-kit';
import Header from '../../components/header/header';

const Home = () => {

  return (
    <div>
      <Header />
      <div className="featured-services">
        <div style={{ marginRight: 250}}>
          <h1 style={{ marginBottom: 20 }}>Featured Services</h1>
          <MDBNavbarLink>
            <MDBBtn
              rounded className='mx-2' color='black'
              href='#ourservices'
              style={{ fontSize: 15}}
            >
              All Services
            </MDBBtn>
          </MDBNavbarLink>
        </div>

        <div>
          <h3>Service 1 ------------------ +</h3>
          <h3>Service 2 ------------------ +</h3>
          <h3>Service 3 ------------------ +</h3>
          <h3>Service 4 ------------------ +</h3>
          <p>Add featured service drop down here with descriptions :basic mani, basic pedi, spa pedi, and deuluxe pedi</p>
        </div>
      </div>

      {/* <img src="/images/img7.png" alt="image1" style={{height:400, width:"100%"}}></img> */}
      {/* <div style={{ backgroundImage: "url('https://zstonecreations.com/wp-content/uploads/2020/02/ZSE_WhiteMarbleHeader02-1024x485.jpg')", height: 500, width:"100%",  }}></div> */}

      <div class="about-us" style={{ display: "flex", flexDirection: "row"}}>
        <div style={{marginTop:50}}>
            <h1 style={{fontSize:50}}>More About our Business</h1>
        </div>

        <div style={{marginTop:400, marginLeft:400, marginRight:0}}>
        <img src="/images/image1.avif" alt="image1" style={{width: "100%"}}></img>
        </div>

        <div style={{marginTop:150, margin: 50}}>
        <img src="/images/image3.avif" alt="image1" style={{width: "80%", margin:50}}></img>
        <p>Our small business-owned nail salon is run by three highly skilled nail technicians with years of industry expertise. They specialize in a wide range of nail care services such as SNS, crylic, gel, and so on.</p>
        <p>Their goal is to provide their clients with the best possible service while maintaining the highest standard of sanitization.</p>
        <p>Explore our gallery to see some of their greatest works over the years, along with those of other incredibly skilled nail technicians.</p>
        <MDBNavbarLink>
            <MDBBtn
              outline rounded className='mx-2 custom-hover' color='black'
              href='gallery'
              style={{ fontSize: 15}}
            >
              Gallery
            </MDBBtn>
          </MDBNavbarLink>
        </div>
      </div>


        {/* <div>
        <h1 style={{textAlign:"center", padding:80}}>Services we offer</h1>

        <div style={{ display: "flex", flexDirection: "row-reverse", textAlign:"center" }}> 
         <MDBNavbarLink href='services'>
            <div>
                <img src="/images/3.png" alt="mani-icon" style={{width: "50%", borderRadius: "50%"}}></img>
                <h3>Waxing</h3>
            </div>
          </MDBNavbarLink>

          <MDBNavbarLink href='services'>
            <div>
                <img src="/images/2.png" alt="mani-icon" style={{width: "50%", borderRadius: "50%"}}></img>
                <h3>Pedicure</h3>
            </div>
          </MDBNavbarLink>

            <MDBNavbarLink href='services'>
            <div>
                <img src="/images/1.png" alt="mani-icon" style={{width: "50%", borderRadius: "50%"}}></img>
                <h3>Manicure</h3>
            </div>
          </MDBNavbarLink>
        </div>
      </div>  
       */}
       <div style={{margin:150}}>
  <style>
    {`
    // .service-link {
    //   text-decoration: none;
    //   position: relative;
    //   transition: color 0.3s;
    // }

    // .service-link::after {
    //   content: '';
    //   position: absolute;
    //   bottom: -5px; 
    //   left: 0;
    //   width: 0;
    //   height: 2px;
    //   background-color: black; 
    //   transition: width 0.3s;
    // }

    // .service-link:hover {
    //   color: black; 
    // }

    // .service-link:hover::after {
    //   width: 100%;
    //   text-align: 
    // }

    .service-link img{
      transition: transform 0.3s;
    }

    .service-link:hover img{
      transform: scale(1.1);
    }
    `}
  </style>

  <h1 style={{ textAlign: "center", margin: 80 }}>Our Services</h1>

  <div
    id='ourservices'
    style={{
    display: 'grid',
    gridTemplateColumns: "auto auto auto",
    textAlign:'center',
    }}
  >
 <MDBNavbarLink href="services" className="service-link">
      <div>
        <img
          src="/images/mani-icon.png"
          alt="mani-icon"
          style={{ width: "50%", borderRadius: "50%" }}
        />
        <h3 style={{marginTop:30}}>Manicure</h3>
      </div>
    </MDBNavbarLink> 

    <MDBNavbarLink href="/services#pedi-treatments" className="service-link">
      <div>
        <img
          src="/images/pedi-icon.png"
          alt="pedi-icon"
          style={{ width: "50%", borderRadius: "50%" }}
        />
        <h3 style={{marginTop:30}}>Pedicure</h3>
      </div>
    </MDBNavbarLink> 

    <MDBNavbarLink href="services" className="service-link">
      <div>
        <img
          src="/images/wax-icon.png"
          alt="wax-icon"
          style={{ width: "50%", borderRadius: "50%" }}
        />
        <h3 style={{marginTop:30}}>Wax/ Hair Removal</h3>
      </div>
    </MDBNavbarLink>

    <MDBNavbarLink href="services" className="service-link">
      <div>
        <img
          src="/images/gel.png"
          alt="gelmachine-icon"
          style={{ width: "50%", borderRadius: "50%" }}
        />
        <h3 style={{marginTop:30}}>Gel</h3>
      </div>
    </MDBNavbarLink>

    <MDBNavbarLink href="services" className="service-link">
      <div>
        <img
          src="/images/full set.png"
          alt="fullset-icon"
          style={{ width: "50%", borderRadius: "50%" }}
        />
        <h3 style={{marginTop:30}}>Full Sets</h3>
      </div>
    </MDBNavbarLink>

    <MDBNavbarLink href="services" className="service-link">
      <div>
        <img
          src="/images/fillin.png"
          alt="fillins-icon"
          style={{ width: "50%", borderRadius: "50%" }}
        />
        <h3 style={{marginTop:30}}>Fill Ins</h3>
      </div>
    </MDBNavbarLink>

    <MDBNavbarLink href="services" className="service-link">
      <div>
        <img
          src="/images/kidhands.png"
          alt="kidhands-icon"
          style={{ width: "50%", borderRadius: "50%" }}
        />
        <h3 style={{marginTop:30}}>Kid Services</h3>
      </div>
    </MDBNavbarLink>

  </div>
  <MDBNavbarLink style={{padding: 100, textAlign: 'center'}}>
            <MDBBtn
              outline rounded className='mx-2 custom-hover' color='black'
              href='services'
              style={{ fontSize: 15}}
            >
              Browse Services
            </MDBBtn>
          </MDBNavbarLink>


</div>

    </div>
  );
}

export default Home;
